window.bookSummaryJSON = "<p>Responsible for her friend's death, Lieutenant Caslin Ahn wants nothing more than to be left alone. She no longer deserves the company of comrades or the fulfillment she felt as a Wolf Squadron fighter pilot. But a summons from the king leaves her with no choice but to rejoin her teammates. An ancient evil has been unleashed, bringing death and destruction to the nation, and they are the only ones with a chance of stopping it. </p> <p>Dragon Blood Book Six brings back Cas, Tolemek, Ridge, Sardelle, Kaika, and Tylie, as well as her dragon, for a new epic fantasy adventure. </p>"; 
